import React from "react";

function Login(){
    return(
        <div>
            <form onSubmit={handleSubmission}>
                <input placeholder="Enter your Email"
                type="email"
                required/><br/>

                <input placeholder="Enter your Password"
                type="password"
                required/><br/>

                <button type="submit">Login</button>
            </form>
        </div>
    )
}

export default Login;
